import React from 'react';
import { Table, Tag, Space, Card, Avatar, Input, Button, Spin, Alert, Switch } from 'antd';
import * as dummy from './dummydata'
import './styles.css'
import { UserOutlined, AntDesignOutlined, SearchOutlined } from '@ant-design/icons';
import { CollectionPlay } from 'react-bootstrap-icons';


const columns = [
  {
    title: 'Session Name',
    dataIndex: 'name',
    key: 'name',
    render: text => <a style={{color:'white'}}>{text}</a>,
  },
  {
    title: 'Start Time',
    dataIndex: 'start_time',
    key: 'start_time',
  },
  {
    title: 'End Time',
    dataIndex: 'end_time',
    key: 'end_time',
  },
  {
    title: 'Tags',
    key: 'tags',
    dataIndex: 'tags',
    render: tags => (
        <>
          {tags.map(tag => (
            <Tag color="pink" style={{backgroundColor:"transparent", color:'white'}} key={tag}>
              {tag}
            </Tag>
          ))}
        </>
      )
  },
  {
    title: 'Total Participants',
    dataIndex: 'total_participants',
    key: 'total_participants',
    align: 'center',

  },
  {
    title: 'Users',
    key: 'users',
    render: () => (
        <Avatar.Group>
        <Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />
        <Avatar style={{ backgroundColor: '#59BDF3' }}>K</Avatar>
        <Avatar style={{ backgroundColor: '#E66286' }} icon={<UserOutlined />} />
        <Avatar style={{ backgroundColor: '#FF935A' }} icon={<AntDesignOutlined />} />
      </Avatar.Group>
    ),
  },
  {
    title: 'Action',
    key: 'action',
    render: (text, record) => (
      <Space size="middle">
        <a>View</a>
      </Space>
    ),
  },
];



const Session = () => {
    const [loading, setLoading] = React.useState(true)
    setInterval(function(){ setLoading(false) }, 3000);
    return ( 
        <div style={{borderRadius:'20px', overflow:'hidden'}}>


        <Spin spinning={loading} delay={500} tip="Loading...">


        <div style={{overflow:'scroll', borderRadius:'20px', backgroundColor:'#3A3C41', padding:'20px', boxShadow: '0px 0px 20px 1px #202225'}} 
        >
            <div style={{marginLeft:'10px', fontSize:'20px', marginBottom:'10px', display:'flex', flexDirection:'row', alignItems:'center'}}>All Sessions <CollectionPlay style={{marginLeft:'10px'}}/></div>
            <Table 
            pagination={false}
            columns={columns} 
            dataSource={dummy.data} />
        </div>
        </Spin>
        </div>

     );
}

export default Session;
